import React from 'react';

/**
 * Component responsible for rendering loading states.
 */
export default class Loading extends React.Component {
	render() {

		const { template } = this.props;

		if ( template === 'video' ) {
			return <VideoPlayer />
		}
	}
}

function VideoPlayer(props) {
	return <h1>video</h1>;
}
